pragma solidity ^0.5.0;

interface PocPoolInterface {

    /*----------  ADMINISTRATOR ONLY FUNCTIONS  ----------*/
    function setPocTokenAddress(address _poc_token) external;
    function setCitizenAddress(address _citizen) external;

    /*----------  WRITABLE FUNCTIONS  ----------*/
    function addTransaction(string calldata _uid, string calldata _username, string calldata _ref_by, uint256 _amount, string calldata _merchant, string calldata _subid, uint256 _release, uint256[10] calldata _ref_rates) external returns (string memory);
    function revokeTransaction(string calldata _uid) external returns (string memory);
    function distributeTransaction(string calldata _uid) external;

    /*----------  READABLE FUNCTIONS  ----------*/
    function getCitizenWallet(string calldata _username) external view returns (address);
    function getCitizenRefBy(string calldata _username) external view returns (address);
    function getDirectRevenue(string calldata _username, string calldata _merchant, uint24 _month) external view returns (uint256);
    function getRefRate(uint256 _id) external view returns (uint256);

    event transactionAdded(string _uid, string _username, string _ref_by, uint256 _amount, string _merchant, string _subid, uint256 _release, uint256[10] _ref_rates);

    event transactionRevoked(string _uid);
    event transactionDistributed(string _uid);
    event migrationSet(uint256 _pool_migration);
    event tokenWithdrawed(address _wallet_address);
}
